import {Button} from "@mui/material/Button";
import {Grid} from "@mui/material/Grid";
import {Item} from "@mui/material/Grid";


const array = ["hola", "hola2", "hola3"];

function Home() {
  return (
    <>
      {array.map((element) => {
        return <Button variant="text">{element}</Button>;
      })}

      <Grid container spacing={2}>
        <Grid item xs={8}>
          <Item>xs=8</Item>
        </Grid>
        <Grid item xs={4}>
          <Item>xs=4</Item>
        </Grid>
        <Grid item xs={4}>
          <Item>xs=4</Item>
        </Grid>
        <Grid item xs={8}>
          <Item>xs=8</Item>
        </Grid>
      </Grid>
    </>
  );
}

export default Home;
